import React, { useEffect, useState } from 'react';
import axios from 'axios';

const COINS = ['bitcoin', 'ethereum', 'solana', 'dogecoin', 'binancecoin', 'ripple', 'cardano',''];

const TABS = [
  { label: 'Top Gainers', key: 'gainers' },
  { label: 'Top Losers', key: 'losers' },
  { label: 'Most Active', key: 'active' },
];

const CryptoMarketHighlights = ({ className = "" }) => {
  const [cryptos, setCryptos] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [activeTab, setActiveTab] = useState('active');

  useEffect(() => {
    setLoading(true);
    setError('');
    axios
      .get(
        `https://api.coingecko.com/api/v3/coins/markets`,
        {
          params: {
            vs_currency: 'usd',
            ids: COINS.join(','),
            order: 'market_cap_desc',
            per_page: COINS.length,
            page: 1,
            price_change_percentage: '24h'
          }
        }
      )
      .then(res => {
        setCryptos(res.data);
        setLoading(false);
      })
      .catch(() => {
        setError('Failed to load crypto market highlights.');
        setLoading(false);
      });
  }, []);

  // Sorting logic for tabs
  let displayCryptos = [...cryptos];
  if (activeTab === 'gainers') {
    displayCryptos.sort((a, b) => (b.price_change_percentage_24h || 0) - (a.price_change_percentage_24h || 0));
  } else if (activeTab === 'losers') {
    displayCryptos.sort((a, b) => (a.price_change_percentage_24h || 0) - (b.price_change_percentage_24h || 0));
  } // else 'active' just shows as is (by market cap)

  return (
    <div className={`bg-[#1E293B] rounded-2xl shadow-lg p-6 min-h-[420px] ${className}`}>
      <h2 className="text-xl font-semibold mb-4">Crypto Market Highlights</h2>
      <div className="flex space-x-6 mb-2 border-b border-[#334155]">
        {TABS.map(tab => (
          <button
            key={tab.key}
            className={`pb-2 text-sm font-medium transition ${
              activeTab === tab.key
                ? 'text-[#38bdf8] border-b-2 border-[#38bdf8]'
                : 'text-gray-400 hover:text-[#38bdf8]'
            }`}
            onClick={() => setActiveTab(tab.key)}
          >
            {tab.label}
          </button>
        ))}
      </div>
      {loading ? (
        <p>Loading...</p>
      ) : error ? (
        <p className="text-red-500">{error}</p>
      ) : (
        <div className="overflow-x-auto">
          <table className="min-w-full text-sm">
            <thead>
              <tr className="text-gray-400 border-b border-gray-700">
                <th className="px-2 py-1 text-left">Crypto</th>
                <th className="px-2 py-1 text-right">Price</th>
                <th className="px-2 py-1 text-right">Change</th>
                <th className="px-2 py-1 text-right">Chg %</th>
              </tr>
            </thead>
            <tbody>
              {displayCryptos.map((coin) => (
                <tr key={coin.id} className="border-b border-gray-800 hover:bg-[#0F172A]">
                  <td className="px-2 py-1 flex items-center gap-2">
                    <img src={coin.image} alt={coin.symbol} className="w-5 h-5 inline-block" />
                    <span className="font-medium">{coin.symbol.toUpperCase()}</span>
                  </td>
                  <td className="px-2 py-1 text-right">${coin.current_price.toLocaleString()}</td>
                  <td className={`px-2 py-1 text-right ${coin.price_change_24h >= 0 ? 'text-green-400' : 'text-red-400'}`}>
                    {coin.price_change_24h?.toFixed(2)}
                  </td>
                  <td className={`px-2 py-1 text-right ${coin.price_change_percentage_24h >= 0 ? 'text-green-400' : 'text-red-400'}`}>
                    {coin.price_change_percentage_24h?.toFixed(2)}%
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
};

export default CryptoMarketHighlights;
